import './App.css';
import Menu from './componentes/Menu';
import LigasPagina from './paginas/LigasPagina';
import Footer from './componentes/Footer';
import InicioPagina from './paginas/InicioPagina';
import ContactoPagina from './paginas/ContactoPagina';
import NacionalPagina from './paginas/NacionalPagina';
import ClubsPagina from './paginas/ClubsPagina';
import JugadoresPagina from './paginas/JugadoresPagina';
import TorneosPagina from './paginas/TorneosPagina';
import MundialQatar from './paginas/MundialQatar';
import SidebarData from './componentes/SidebarData';
import { Routes, Route, BrowserRouter as Router } from 'react-router-dom';



function App() {
  return (
    <>
      <Router>
        <Menu />
     <div className="container pt-5 mt-5">


      <Routes>
        <Route path="/" element={<InicioPagina />} />
        <Route path="/Contacto" element={<ContactoPagina />} />
        <Route path="/Ligas" element={<LigasPagina />} />
        <Route path="/Nacional" element={<NacionalPagina />} />
        <Route path="/Torneos" element={<TorneosPagina />} />
        <Route path="/Jugadores" element={<JugadoresPagina />} />
        <Route path="/MundialQatar" element={<MundialQatarPagina />} />
        <Route path="/Clubs" element={<ClubsPagina />} />
      </Routes>



      <SidebarData />


<Footer />



    </div>
      </Router>
        </>
  );
}

export default App;
